contracts/ImageDAO.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
/**
 * @title ImageDAO - Data DAO for Image Storage with DataCoin Rewards
 * @dev Users earn DataCoins for uploading quality images to Lighthouse/Filecoin
 */

contract DataCoin is ERC20, Ownable {
    constructor() ERC20("DataCoin", "DATA") Ownable(msg.sender) {
        _mint(msg.sender, 1000000 * 10**decimals()); // 1M initial supply
    }

    function mint(address to, uint256 amount) external onlyOwner {
        _mint(to, amount);
    }
}

contract ImageDAO is ReentrancyGuard, Ownable {
    DataCoin public dataCoin;
    uint256 private _imageIds;

    // Reward amounts (in DataCoin wei)
    uint256 public constant UPLOAD_REWARD = 10 * 10**18;  // 10 DataCoins
    uint256 public constant VALIDATION_REWARD = 2 * 10**18;  // 2 DataCoins
    uint256 public constant ACCESS_FEE = 1 * 10**18;  // 1 DataCoin
    uint256 public constant MIN_STAKE = 100 * 10**18;  // 100 DataCoins to become validator

    struct ImageData {
        uint256 id;
        address uploader;
        string lighthouseCID;  // IPFS hash from Lighthouse
        string metadata;       // JSON metadata
        uint256 uploadTime;
        uint256 qualityScore;  // 0-100 from AI validation
        bool isValidated;
        bool isPremium;
        uint256 views;
        uint256 rewards;
    }

    struct Validator {
        bool isActive;
        uint256 stakedAmount;
        uint256 validationsCount;
        uint256 reputationScore;
    }

    // Storage
    mapping(uint256 => ImageData) public images;
    mapping(address => Validator) public validators;
    mapping(uint256 => mapping(address => bool)) public hasValidated;
    mapping(address => uint256[]) public userImages;

    // Events
    event ImageUploaded(uint256 indexed imageId, address indexed uploader, string cid);
    event ImageValidated(uint256 indexed imageId, address indexed validator, uint256 score);
    event RewardClaimed(address indexed user, uint256 amount);
    event ValidatorRegistered(address indexed validator, uint256 stakedAmount);
    event PremiumAccess(uint256 indexed imageId, address indexed accessor);

    constructor(address _dataCoin) Ownable(msg.sender) {
        dataCoin = DataCoin(_dataCoin);
    }

    /**
     * @dev Upload image to DAO and earn DataCoins
     * @param _cid Lighthouse IPFS CID
     * @param _metadata JSON metadata string
     */
    function uploadImage(
        string memory _cid,
        string memory _metadata,
        uint256 _qualityScore
    ) external {
        require(bytes(_cid).length > 0, "CID required");
        require(_qualityScore <= 100, "Invalid quality score");

        _imageIds++;
        uint256 newImageId = _imageIds;

        images[newImageId] = ImageData({
            id: newImageId,
            uploader: msg.sender,
            lighthouseCID: _cid,
            metadata: _metadata,
            uploadTime: block.timestamp,
            qualityScore: _qualityScore,
            isValidated: false,
            isPremium: _qualityScore >= 80, // High quality = premium
            views: 0,
            rewards: 0
        });

        userImages[msg.sender].push(newImageId);

        // Reward uploader with DataCoins
        _rewardUser(msg.sender, UPLOAD_REWARD, newImageId);

        emit ImageUploaded(newImageId, msg.sender, _cid);
    }

    /**
     * @dev Validators can validate uploaded images
     * @param _imageId Image to validate
     * @param _score Quality score (0-100)
     */
    function validateImage(uint256 _imageId, uint256 _score) external {
        require(validators[msg.sender].isActive, "Not a validator");
        require(!hasValidated[_imageId][msg.sender], "Already validated");
        require(_score <= 100, "Invalid score");
        require(images[_imageId].id != 0, "Image doesn't exist");

        hasValidated[_imageId][msg.sender] = true;
        validators[msg.sender].validationsCount++;

        // Update image quality score (simple average for now)
        images[_imageId].qualityScore = (_score + images[_imageId].qualityScore) / 2;
        images[_imageId].isValidated = true;

        // Reward validator
        _rewardUser(msg.sender, VALIDATION_REWARD, _imageId);

        emit ImageValidated(_imageId, msg.sender, _score);
    }

    /**
     * @dev Access premium images by paying DataCoins
     * @param _imageId Image to access
     */
    function accessPremiumImage(uint256 _imageId) external {
        require(images[_imageId].isPremium, "Not a premium image");
        require(dataCoin.balanceOf(msg.sender) >= ACCESS_FEE, "Insufficient DataCoins");

        dataCoin.transferFrom(msg.sender, address(this), ACCESS_FEE);
        images[_imageId].views++;

        // Distribute fee to uploader (80%) and DAO treasury (20%)
        uint256 uploaderReward = (ACCESS_FEE * 80) / 100;
        uint256 treasuryFee = ACCESS_FEE - uploaderReward;

        dataCoin.transfer(images[_imageId].uploader, uploaderReward);
        // treasuryFee stays in contract

        emit PremiumAccess(_imageId, msg.sender);
    }

    /**
     * @dev Become a validator by staking DataCoins
     * @param _amount Amount to stake
     */
    function becomeValidator(uint256 _amount) external {
        require(_amount >= MIN_STAKE, "Insufficient stake");
        require(!validators[msg.sender].isActive, "Already a validator");

        dataCoin.transferFrom(msg.sender, address(this), _amount);

        validators[msg.sender] = Validator({
            isActive: true,
            stakedAmount: _amount,
            validationsCount: 0,
            reputationScore: 100 // Start with perfect reputation
        });

        emit ValidatorRegistered(msg.sender, _amount);
    }

    /**
     * @dev Internal function to reward users
     */
    function _rewardUser(address _user, uint256 _amount, uint256 _imageId) internal {
        dataCoin.mint(_user, _amount);
        images[_imageId].rewards += _amount;
        emit RewardClaimed(_user, _amount);
    }

    /**
     * @dev Get user's uploaded images
     */
    function getUserImages(address _user) external view returns (uint256[] memory) {
        return userImages[_user];
    }

    /**
     * @dev Get image details
     */
    function getImage(uint256 _imageId) external view returns (ImageData memory) {
        return images[_imageId];
    }

    /**
     * @dev Get total number of images
     */
    function getTotalImages() external view returns (uint256) {
        return _imageIds;
    }

    /**
     * @dev Check if user can access premium image
     */
    function canAccessPremium(address _user) external view returns (bool) {
        return dataCoin.balanceOf(_user) >= ACCESS_FEE;
    }
}

